import styled from 'styled-components';

const Container = styled.div`
  position: relative;
  width: 100vh;
  height: 40vh;
  background: black;
`;
const Card = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  margin: -25px 0 0 -25px;
  color: white;
`;
const FieldWrapper = styled.div``;
const Type = styled.span``;
const Number = styled.span``;
const Expiration = styled.span``;
const Owner = styled.span``;

const CCMaker = () => {
  return (
    <Container>
      <Card>
        <FieldWrapper>
          <Number></Number>
        </FieldWrapper>
        <FieldWrapper>
          <Expiration></Expiration>
        </FieldWrapper>
        <FieldWrapper>
          <Owner></Owner>
        </FieldWrapper>
        <FieldWrapper>
          <Type></Type>
        </FieldWrapper>
      </Card>
      ;
    </Container>
  );
};

export default CCMaker;
